\"\u041d\u0430\u0432\u0443\u0445\u043e\u0434\u043e\u043d\u043e\u0441\u043e\u0440 II\">\u041d\u0430\u0432\u0443\u0445\u043e\u0434\u043e\u043d\u043e\u0441\u043e\u0440 II<\/a> \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u043b \u0418\u0435\u0440\u0443\u0441\u0430\u043b\u0438\u043c \u0438 \u0441\u0436\u0451\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D0%A5%D1%80%D0%B0%D0%BC\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0425\u0440\u0430\u043c\">\u041f\u0435\u0440\u0432\u044b\u0439 \u0425\u0440\u0430\u043c<\/a>, \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%BB%D0%BE%D0%BC%D0%BE%D0%BD\" title=\"\u0421\u043e\u043b\u043e\u043c\u043e\u043d\">\u0421\u043e\u043b\u043e\u043c\u043e\u043d\u043e\u043c<\/a> \u0432 IX \u0432\u0435\u043a\u0435 \u0434\u043e&#160;\u043d.&#160;\u044d.  \u041d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%B2%D0%B8%D0%BB%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BB%D0%B5%D0%BD\" title=\"\u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0441\u043a\u0438\u0439 \u043f\u043b\u0435\u043d\">\u0412\u0430\u0432\u0438\u043b\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u043f\u043b\u0435\u043d\u0435\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/258_%D0%B3%D0%BE%D0%B4\" title=\"258 \u0433\u043e\u0434\">258<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%9B%D0%B0%D0%B2%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D0%B9\" class=\"mw-redirect\" title=\"\u0421\u0432\u044f\u0442\u043e\u0439 \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u0439\">\u0421\u0432\u044f\u0442\u043e\u0439 \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u0439<\/a> \u0441\u043e\u0436\u0436\u0451\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC\" title=\"\u0420\u0438\u043c\">\u0420\u0438\u043c\u0435<\/a> \u043d\u0430 \u043c\u0435\u0434\u043b\u0435\u043d\u043d\u043e\u043c \u043e\u0433\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/843_%D0%B3%D0%BE%D0%B4\" title=\"843 \u0433\u043e\u0434\">843<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D0%B4%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0412\u0435\u0440\u0434\u0435\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0412\u0435\u0440\u0434\u0435\u043d\u0441\u043a\u0438\u043c \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u043c<\/a> \u0438\u043c\u043f\u0435\u0440\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" title=\"\u041a\u0430\u0440\u043b \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041a\u0430\u0440\u043b\u0430 \u0412\u0435\u043b\u0438\u043a\u043e\u0433\u043e<\/a> \u043f\u043e\u0434\u0435\u043b\u0435\u043d\u0430 \u043c\u0435\u0436\u0434\u0443 \u0435\u0433\u043e \u0442\u0440\u0435\u043c\u044f \u0432\u043d\u0443\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/955_%D0%B3%D0%BE%D0%B4\" title=\"955 \u0433\u043e\u0434\">955<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BD%D0%B0_%D1%80%D0%B5%D0%BA%D0%B5_%D0%9B%D0%B5%D1%85\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043d\u0430 \u0440\u0435\u043a\u0435 \u041b\u0435\u0445\">\u0431\u0438\u0442\u0432\u0435 \u043d\u0430 \u0440\u0435\u043a\u0435 \u041b\u0435\u0445<\/a> \u0433\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%82%D1%82%D0%BE%D0%BD_I_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B8%D0%B9\" title=\"\u041e\u0442\u0442\u043e\u043d I \u0412\u0435\u043b\u0438\u043a\u0438\u0439\">\u041e\u0442\u0442\u043e\u043d I \u0412\u0435\u043b\u0438\u043a\u0438\u0439<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b \u0432\u0435\u043d\u0433