0%BB,_%D0%9F%D0%B5%D0%B4%D1%80%D1%83\" class=\"mw-redirect\" title=\"\u0410\u043b\u0432\u0430\u0440\u0435\u0448 \u041a\u0430\u0431\u0440\u0430\u043b, \u041f\u0435\u0434\u0440\u0443\">\u041a\u0430\u0431\u0440\u0430\u043b\u0430<\/a> (Pedro \u00c1lvares Cabral), \u043e\u0442\u043a\u0440\u044b\u043b \u043e\u0441\u0442\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B4%D0%B0%D0%B3%D0%B0%D1%81%D0%BA%D0%B0%D1%80\" title=\"\u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440\">\u041c\u0430\u0434\u0430\u0433\u0430\u0441\u043a\u0430\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1512_%D0%B3%D0%BE%D0%B4\" title=\"1512 \u0433\u043e\u0434\">1512<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%9A%D0%B0%D0%BC%D0%B1%D1%80%D0%B5%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%B8%D0%B3%D0%B8\" title=\"\u0412\u043e\u0439\u043d\u0430 \u041a\u0430\u043c\u0431\u0440\u0435\u0439\u0441\u043a\u043e\u0439 \u043b\u0438\u0433\u0438\">\u0412\u043e\u0439\u043d\u044b \u041a\u0430\u043c\u0431\u0440\u0435\u0439\u0441\u043a\u043e\u0439 \u043b\u0438\u0433\u0438<\/a> \u043c\u0435\u0436\u0434\u0443 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c \u0438 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0444\u043b\u043e\u0442\u0430\u043c\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D1%80%D0%B8_%D0%A1%D0%B5%D0%BD-%D0%9C%D0%B0%D1%82%D1%8C%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0421\u0435\u043d-\u041c\u0430\u0442\u044c\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0438 \u0421\u0435\u043d-\u041c\u0430\u0442\u044c\u0435<\/a> .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1519_%D0%B3%D0%BE%D0%B4\" title=\"1519 \u0433\u043e\u0434\">1519<\/a>&#160;\u2014 \u044d\u0441\u043a\u0430\u0434\u0440\u0430, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B3%D0%B5%D0%BB%D0%BB%D0%B0%D0%BD,_%D0%A4%D0%B5%D1%80%D0%BD%D0%B0%D0%BD\" title=\"\u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d, \u0424\u0435\u0440\u043d\u0430\u043d\">\u0424\u0435\u0440\u043d\u0430\u043d\u0434\u043e \u041c\u0430\u0433\u0435\u043b\u043b\u0430\u043d\u043e\u043c<\/a>, \u043e\u0442\u043f\u043b\u044b\u043b\u0430 \u0432 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044e \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0_%D0%9F%D1%80%D1%8F%D0%BD%D0%BE%D1%81%D1%82%D0%B5%D0%B9\" class=\"mw-redirect\" title=\"\u041e\u0441\u0442\u0440\u043e\u0432\u0430 \u041f\u0440\u044f\u043d\u043e\u0441\u0442\u0435\u0439\">\u041e\u0441\u0442\u0440\u043e\u0432\u0430\u043c \u041f\u0440\u044f\u043d\u043e\u0441\u0442\u0435\u0439<\/a>, \u043f\u0440\u0435\u0432\u0440\u0430\u0442\u0438\u0432\u0448\u0443\u044e\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%BE%D0%B5_%D0%BA%D1%80%D1%83%D0%B3%D0%BE%D1%81%D0%B2%D0%B5%D1%82%D0%BD%D0%BE%D0%B5_%D0%BF%D0%BB%D0%B0%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u041f\u0435\u0440\u0432\u043e\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435\">\u041f\u0435\u0440\u0432\u043e\u0435 \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u043e\u0435 \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1535_%D0%B3%D0%BE%D0%B4\" title=\"1535 \u0433\u043e\u0434\">1535<\/a>&#160;\u2014 \u0418\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D1%82%D1%8C%D0%B5,_%D0%96%D0%B0%D0%BA\" title=\"\u041a\u0430\u0440\u0442\u044c\u0435, \u0416\u0430\u043a\">\u0416\u0430\u043a \u041a\u0430\u0440\u0442\u044c\u0435<\/a> \u043d\u0430\u0437\u0432\u0430\u043b \u0438\u0441\u0441\u043b\u0435\u0434\u0443\u0435\u043c\u044b\u0435 \u0438\u043c \u0440\u0435\u043a\u0443 \u0438 \u0437\u0430\u043b\u0438\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0435<\/a> \u0438\u043c\u0435\u043d\u0435\u043c \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u041b\u0430\u0432\u0440\u0435\u043d\u0442\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1539_%D0%B3%D0%BE%D0%B4\" title=\"1539 \u0433\u043e\u0434\">1539<\/a>&#160;\u2014 \u041a\u043e\u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%81%D0%BA_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a I (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u0424\u0440\u0430\u043d\u0446\u0438\u0441\u043a I<\/a> \u0432\u0432\u0451\u043b \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u044f\u0437\u044b\u043a: \u043e\u043d \u043f\u0440\u0438\u043a\u0430\u0437\u0430\u043b \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c \u0432\u0441\u0435 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0435 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u044b \u043d\u0435 \u043d\u0430 \u043b\u0430\u0442\u044b\u043d\u0438, \u0430 \u043d\u0430 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u043c \u044f\u0437\u044b\u043a\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1557_%D0%B3%D0%BE%D0%B4\" title=\"1557 \u0433\u043e\u0434\">1557<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0_(1551%E2%80%941559)\" title=\"\u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1551\u20141559)\">\u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430 (1551\u20141559)<\/a>: \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%A1%D0%B5%D0%BD-%D0%9A%D0%B0%D0%BD%D1%82%D0%B5%D0%BD%D0%B5_(1557)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0421\u0435\u043d-\u041a\u0430\u043d\u0442\u0435\u043d\u0435 (1557)\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0421\u0435\u043d-\u041a\u0430\u043d\u0442\u0435\u043d\u0435<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0430\u044f \u0430\u0440\u043c\u0438\u044f \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BC%D0%BC%D0%B0%D0%BD%D1%83%D0%B8%D0%BB_%D0%A4%D0%B8%D0%BB%D0%B8%D0%B1%D0%B5%D1%80%D1%82\" title=\"\u042d\u043c\u043c\u0430\u043d\u0443\u0438\u043b \u0424\u0438\u043b\u0438\u0431\u0435\u0440\u0442\">\u042d\u043c\u043c\u0430\u043d\u0443\u0438\u043b\u0430 \u0424\u0438\u043b\u0438\u0431\u0435\u0440\u0442\u0430 \u0421\u0430\u0432\u043e\u0439\u0441\u043a\u043e\u0433\u043e<\/a> \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0430 \u0440\u0435\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u0443\u044e \u043f\u043e\u0431\u0435\u0434\u0443 \u043d\u0430\u0434 \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1628_%D0%B3%D0%BE%D0%B4\" title=\"1628 \u0433\u043e\u0434\">1628<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%BE%D0%BA%D0%B3%D0%BE%D0%BB%D1%8C%D0%BC\" title=\"\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\">\u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0435<\/a> \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0441\u0432\u043e\u0435\u0433\u043e \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043f\u043b\u0430\u0432\u0430\u043d\u0438\u044f \u043e\u043f\u0440\u043e\u043a\u0438\u043d\u0443\u043b\u0441\u044f \u0438 \u0437\u0430\u0442\u043e\u043d\u0443\u043b \u043a\u043e\u0440\u0430\u0431\u043b\u044c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%B7%D0%B0_(%D0%BA%D0%BE%D1%80%D0%B0%D0%B1%D0%BB%D1%8C)\" title=\"\u0412\u0430\u0437\u0430 (\u043a\u043e\u0440\u0430\u0431\u043b\u044c)\">\u0412\u0430\u0437\u0430<\/a>\u00bb<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1675_%D0%B3%D0%BE%D0%B4\" title=\"1675 \u0433\u043e\u0434\">1675<\/a>&#160;\u2014 \u041a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BB_II_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041a\u0430\u0440\u043b II \u0421\u0442\u044e\u0430\u0440\u0442\">\u041a\u0430\u0440\u043b II<\/a> \u0437\u0430\u043b\u043e\u0436\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043a\u0430\u043c\u0435\u043d\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%BD%D0%B2%D0%B8%D1%87%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D1%81%D0%B5%D1%80%D0%B2%D0%B0%D1%82%D0%BE%D1%80%D0%B8%D1%8F\" title=\"\u0413\u0440\u0438\u043d\u0432\u0438\u0447\u0441\u043a\u0430\u044f \u043e\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043e\u0440\u0438\u044f\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u043e\u0431