u043e\u0432\u043e\u0440\u044b\">\u043c\u0438\u0440\u043d\u044b\u0445 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u043e\u0432 \u0432 \u041d\u0435\u0439\u043c\u0435\u0433\u0435\u043d\u0435<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0445 \u0434\u043b\u0438\u0432\u0448\u0443\u044e\u0441\u044f \u0431\u043e\u043b\u0435\u0435 \u0448\u0435\u0441\u0442\u0438 \u043b\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BB%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1755_%D0%B3%D0%BE%D0%B4\" title=\"1755 \u0433\u043e\u0434\">1755<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u0432\u043e\u043b\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D0%BF%D0%BE%D1%80%D1%82%D0%B0%D1%86%D0%B8%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D0%BA%D0%BE-%D0%B0%D0%BA%D0%B0%D0%B4%D1%86%D0%B5%D0%B2\" class=\"mw-redirect\" title=\"\u0414\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u044f \u0444\u0440\u0430\u043d\u043a\u043e-\u0430\u043a\u0430\u0434\u0446\u0435\u0432\">\u0434\u0435\u043f\u043e\u0440\u0442\u0430\u0446\u0438\u0438 \u0444\u0440\u0430\u043d\u043a\u043e-\u0430\u043a\u0430\u0434\u0446\u0435\u0432<\/a>&#160;\u2014 \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0433\u043e \u0432\u044b\u0441\u0435\u043b\u0435\u043d\u0438\u044f \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u043c\u0438 \u0432\u043b\u0430\u0441\u0442\u044f\u043c\u0438 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BA%D0%B0%D0%B4%D0%B8%D1%8F\" title=\"\u0410\u043a\u0430\u0434\u0438\u044f\">\u0410\u043a\u0430\u0434\u0438\u0438<\/a>, \u043d\u044b\u043d\u0435 \u043d\u0430