dia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_10_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0_1792_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 10 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 1792 \u0433\u043e\u0434\u0430\">\u0412\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 10 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a>&#160;\u2014 \u0448\u0442\u0443\u0440\u043c \u0434\u0432\u043e\u0440\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%8E%D0%B8%D0%BB%D1%8C%D1%80%D0%B8_(%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86)\" class=\"mw-redirect\" title=\"\u0422\u044e\u0438\u043b\u044c\u0440\u0438 (\u0434\u0432\u043e\u0440\u0435\u0446)\">\u0422\u044e\u0438\u043b\u044c\u0440\u0438<\/a>, \u0430\u0440\u0435\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%B4%D0%BE%D0%B2%D0%B8%D0%BA_XVI_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8)\" class=\"mw-redirect\" title=\"\u041b\u044e\u0434\u043e\u0432\u0438\u043a XVI (\u043a\u043e\u0440\u043e\u043b\u044c \u0424\u0440\u0430\u043d\u0446\u0438\u0438)\">\u041b\u044e\u0434\u043e\u0432\u0438\u043a\u0430 XVI<\/a> (Louis XVI de France).<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1809_%D0%B3%D0%BE%D0%B4\" title=\"1809 \u0433\u043e\u0434\">1809<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u042d\u043a\u0432\u0430\u0434\u043e\u0440\">\u042d\u043a\u0432\u0430\u0434\u043e\u0440<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0418\u0441\u043f\u0430\u043d\u0438\u044f\">\u0418\u0441\u043f\u0430\u043d\u0438\u0438<\/a>. \u0420\u0435\u0430\u043b\u044c\u043d\u043e \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0431\u044b\u043b\u0430 \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u0430 \u0442\u043e\u043b\u044c\u043a\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1822_%D0%B3%D0%BE%D0%B4\" title=\"1822 \u0433\u043e\u0434\">1822 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1821_%D0%B3%D0%BE%D0%B4\" title=\"1821 \u0433\u043e\u0434\">1821<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%81%D1%81%D1%83%D1%80%D0%B8_(%D1%88%D1%82%D0%B0%D1%82)\" title=\"\u041c\u0438\u0441\u0441\u0443\u0440\u0438 (\u0448\u0442\u0430\u0442)\">\u041c\u0438\u0441\u0441\u0443\u0440\u0438<\/a> \u0441\u0442\u0430\u043b 24-\u043c \u0448\u0442\u0430\u0442\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1833_%D0%B3%D0%BE%D0%B4\" title=\"1833 \u0433\u043e\u0434\">1833<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BA%D0%B0%D0%B3%D0%BE\" title=\"\u0427\u0438\u043a\u0430\u0433\u043e\">\u0427\u0438\u043a\u0430\u0433\u043e<\/a>. \u0422\u043e\u0433\u0434\u0430 \u044d\u0442\u043e \u0431\u044b\u043b \u043d\u0435 \u0433\u043e\u0440\u043e\u0434, \u0430 \u0434\u0435\u0440\u0435\u0432\u0443\u0448\u043a\u0430 \u043f\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \u0423\u0438\u043d\u0434\u0438-\u0421\u0438\u0442\u0438 \u0441 \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u0435\u043c \u043c\u0435\u043d\u0435\u0435 \u0434\u0432\u0443\u0445\u0441\u043e\u0442 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 \u041d\u0430 \u0434\u0435\u043d\u044c\u0433\u0438, \u0437\u0430\u0432\u0435\u0449\u0430\u043d\u043d\u044b\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0445\u0438\u043c\u0438\u043a\u043e\u043c \u0438 \u043c\u0438\u043d\u0435\u0440\u0430\u043b\u043e\u0433\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B8%D1%82%D1%81%D0%BE%D0%BD,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81\" title=\"\u0421\u043c\u0438\u0442\u0441\u043e\u043d, \u0414\u0436\u0435\u0439\u043c\u0441\">\u0414\u0436\u0435\u0439\u043c\u0441\u043e\u043c \u0421\u043c\u0438\u0442\u0441\u043e\u043d\u043e\u043c<\/a> (James Smithson), \u043e\u0442\u043a\u0440\u044b\u0442\u043e \u043f\u0435\u0440\u0432\u043e\u0435 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u043e\u0435 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u0421\u0428\u0410&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B8%D1%82%D1%81%D0%BE%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82\" title=\"\u0421\u043c\u0438\u0442\u0441\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\">\u0421\u043c\u0438\u0442\u0441\u043e\u043d\u043e\u0432\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442<\/a>. \u0420\u0435\u0448\u0435\u043d\u0438\u0435 \u043e\u0431 \u044d\u0442\u043e\u043c \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u041a\u043e\u043d\u0433\u0440\u0435\u0441\u0441\u043e\u043c \u0435\u0449\u0451 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838 \u0433\u043e\u0434\u0443<\/a>, \u043d\u043e \u0432\u0441\u0435 \u044d\u0442\u0438 \u0433\u043e\u0434\u044b \u0448\u043b\u0438 \u0434\u0435\u0431\u0430\u0442\u044b \u043e \u043d\u0435\u043e\u0431\u0445\u043e\u0434\u0438\u043c\u043e\u0441\u0442\u0438 \u0442\u0430\u043a\u043e\u0433\u043e \u0437\u0430\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0434\u043b\u044f \u0410\u043c\u0435\u0440\u0438\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1876_%D0%B3%D0%BE%D0%B4\" title=\"1876 \u0433\u043e\u0434\">1876<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%BE_(%D0%BF%D1%80%D0%BE%D0%B2%D0%B8%D0%BD%D1%86%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u041e\u043d\u0442\u0430\u0440\u0438\u043e (\u043f\u0440\u043e\u0432\u0438\u043d\u0446\u0438\u044f)\">\u041e\u043d\u0442\u0430\u0440\u0438\u043e<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>) \u0441\u043e\u0432\u0435\u0440\u0448\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u043c\u0435\u0436\u0434\u0443\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D0%BB%D0%B5%D1%84%D0%BE%D0%BD\" title=\"\u0422\u0435\u043b\u0435\u0444\u043e\u043d\">\u0442\u0435\u043b\u0435\u0444\u043e\u043d\u043d\u044b\u0439<\/a> \u0437\u0432\u043e\u043d\u043e\u043a (\u0440\u0430\u0441\u0441\u0442\u043e\u044f\u043d\u0438\u0435 \u043c\u0435\u0436\u0434\u0443 \u0433\u043e\u0440\u043e\u0434\u0430\u043c\u0438 \u0431\u044b\u043b\u043e 13 \u043a\u043c).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0439 \u0445\u0438\u043c\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%84%D1%84%D0%BC%D0%B0%D0%BD%D0%BD,_%D0%A4%D0%B5%D0%BB%D0%B8%D0%BA%D1%81\" title=\"\u0425\u043e\u0444\u0444\u043c\u0430\u043d\u043d, \u0424\u0435\u043b\u0438\u043a\u0441\">\u0424\u0435\u043b\u0438\u043a\u0441 \u0425\u043e\u0444\u0444\u043c\u0430\u043d\u043d<\/a> \u0441\u0438\u043d\u0442\u0435\u0437\u0438\u0440\u043e\u0432\u0430\u043b \u0445\u0438\u043c\u0438\u0447\u0435\u0441\u043a\u0438 \u0447\u0438\u0441\u0442\u0443\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%86%D0%B5%D1%82%D0%B8%D0%BB%D1%81%D0%B0%D0%BB%D0%B8%D1%86%D0%B8%D0%BB%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BA%D0%B8%D1%81%D0%BB%D0%BE%D1%82%D0%B0\" title=\"\u0410\u0446\u0435\u0442\u0438\u043b\u0441\u0430\u043b\u0438\u0446\u0438\u043b\u043e\u0432\u0430\u044f \u043a\u0438\u0441\u043b\u043e\u0442\u0430\">\u0430\u0446\u0435\u0442\u0438\u043b\u0441\u0430\u043b\u0438\u0446\u0438\u043b\u043e\u0432\u0443\u044e \u043a\u0438\u0441\u043b\u043e\u0442\u0443<\/a>, \u043f\u0440\u0438\u0433\u043e\u0434\u043d\u0443\u044e \u0434\u043b\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u0435.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0412\u043e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u043c \u0433\u043e\u0440\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D0%BB%D0%BE%D0%BD%D1%8C-%D1%81%D1%8E%D1%80-%D0%9C%D0%B5%D1%80\" title=\"\u0411\u0443\u043b\u043e\u043d\u044c-\u0441\u044e\u0440-\u041c\u0435\u0440\">\u0411\u0443\u043b\u043e\u043d\u044c-\u0441\u044e\u0440-\u041c\u0435\u0440<\/a> \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BD%D0%B3%D1%80%D0%B5%D1%81%D1%81_%D1%8D%D1%81%D0%BF%D0%B5%D1%80%D0%B0%D0%BD%D1%82%D0%B8%D1%81%D1%82%D0%BE%D0%B2\" title=\"\u0412\u0441\u0435\u043c\u0438\u0440\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u044d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u0438\u0441\u0442\u043e\u0432\">\u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043d\u0433\u0440\u0435\u0441\u0441 \u044d\u0441\u043f\u0435\u0440\u0430\u043d\u0442\u0438\u0441\u0442\u043e\u0432<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 688 \u0447\u0435\u043b\u043e\u0432\u0435\u043a. \u0421 \u0442\u0435\u0445 \u043f\u043e\u0440 \u043f\u043e\u0434\u043e\u0431\u043d\u044b\u0435 \u0432\u0441\u0442\u0440\u0435\u0447\u0438 \u043f\u0440\u043e\u0438\u0441\u0445\u043e\u0434\u044f\u0442 \u0435\u0436\u0435\u0433\u043e\u0434\u043d\u043e \u0432 \u0440\u0430\u0437\u043d\u044b\u0445 \u0433\u043e\u0440\u043e\u0434\u0430\u0445 \u0438 \u0441\u0442\u0440\u0430\u043d\u0430\u0445, \u0438\u0441\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0435\u043c \u0441\u0442\u0430\u043b\u0438 \u0442\u043e\u043b\u044c\u043a\u043e \u043f\u0435\u0440\u0438\u043e\u0434\u044b \u0434\u0432\u0443\u0445 \u043c\u0438\u0440\u043e\u0432\u044b\u0445 \u0432\u043e\u0439\u043d.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u044b\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0430\u043a\u0442 \u043e \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0435 \u043b\u0438\u0448\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BB%D0%B0%D1%82%D0%B0_%D0%BB%D0%BE%D1%80%D0%B4%D0%BE%D0%B2\" title=\"\u041f\u0430\u043b\u0430\u0442\u0430 \u043b\u043e\u0440\u0434\u043e\u0432\">\u043f\u0430\u043b\u0430\u0442\u0443 \u043b\u043e\u0440\u0434\u043e\u0432<\/a> \u043f\u0440\u0430\u0432\u0430 \u0430\u0431\u0441\u043e\u043b\u044e\u0442\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%82%D0%BE\" title=\"\u0412\u0435\u0442\u043e\">\u0432\u0435\u0442\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0417\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%B1%D0%B0%D0%BB%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u0431\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0412\u0442\u043e\u0440\u0430\u044f \u0431\u0430\u043b\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%83%D1%85%D0%B0%D1%80%D0%B5%D1%81%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80_1913_%D0%B3%D0%BE%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u0411\u0443\u0445\u0430\u0440\u0435\u0441\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\u043d\u044b\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440 1913 \u0433\u043e\u0434\u0430\">\u0411\u0443\u0445\u0430\u0440\u0435\u0441\u0442\u0441\u043a\u043e\u0433\u043e \u043c\u0438\u0440\u043d\u043e\u0433\u043e \u0434\u043e\u0433\u043e\u0432\u043e\u0440\u0430 1913 \u0433\u043e\u0434\u0430<\/a> \u043c\u0435\u0436\u0434\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0435\u0439<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D0%BC%D1%8B%D0%BD%D0%B8%D1%8F\" title=\"\u0420\u0443\u043c\u044b\u043d\u0438\u044f\">\u0420\u0443\u043c\u044b\u043